import './Navbar.css';

function Navbar()   {
    return (
    <div >
        <div className='header'>
        <h1>Framework para evaluación de métricas de desempeño de aplicaciones basadas en GPU</h1>
        </div>
        <div >
            <label>Select the applications</label>
            <label>Select the execution mode</label>
            <label>Amount of executions</label>
        </div>
        <div >
            <label>Select the workloads</label>
            <label>Select the GPU frequency</label>
            <label>Amount of blocks</label>
            <label>Amount of threads</label>
        </div>
    </div>
    );
}

export default Navbar;
